script: |
  super -f text -I q12509.spq | sort > q12509.out

inputs:
  - name: q12509.spq
    data: |
      SELECT - 4 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE NOT col2 - 26 + 4 BETWEEN ( NULL ) AND ( + col1 * - col0 );
  - name: tab1

outputs:
  - name: q12509.out
    data: |
      -4
      -4
      -4
